import listShows from "./listShows";
import seenOnBway from "./seenOnBway";

function App() {
    return (
        <div className="Broadway">
            <h1>Broadway Shows I've Seen:</h1>
           <ul><listShows data={listShows} /></ul>
           <ul>{seenOnBway}</ul>
        </div>
    );
}
export default App;
